#pragma once

#include <cmath>
#include <arbor/version.hpp>
#include <arbor/mechanism_abi.h>

extern "C" {
  arb_mechanism_type make__pas_type() {
    // Tables
    static arb_field_info globals[] = {{ "v", "", NAN, -.000000, .000000 },
        { "e", "mV", -70, -.000000, .000000 } };
    static arb_size_type n_globals = 2;
    static arb_field_info state_vars[] = {{ "k", "", NAN, -.000000, .000000 },
        { "gamma", "", NAN, -.000000, .000000 } };
    static arb_size_type n_state_vars = 2;
    static arb_field_info parameters[] = {{ "g", "S / cm2", .001, 0, 1 } };
    static arb_size_type n_parameters = 1;
    static arb_ion_info* ions = NULL;
    static arb_size_type n_ions = 0;

    arb_mechanism_type result;
    result.abi_version=ARB_MECH_ABI_VERSION;
    result.fingerprint="<placeholder>";
    result.name="pas";
    result.kind=arb_mechanism_kind_density;
    result.is_linear=false;
    result.has_post_events=false;
    result.globals=globals;
    result.n_globals=n_globals;
    result.ions=ions;
    result.n_ions=n_ions;
    result.state_vars=state_vars;
    result.n_state_vars=n_state_vars;
    result.parameters=parameters;
    result.n_parameters=n_parameters;
    return result;
  }

  arb_mechanism_interface* make__pas_interface_multicore();
  arb_mechanism_interface* make__pas_interface_gpu();

  #ifndef ARB_GPU_ENABLED
  arb_mechanism_interface* make__pas_interface_gpu() { return nullptr; }
  #endif

  arb_mechanism make__pas() {
    static arb_mechanism result = {};
    result.type  = make__pas_type;
    result.i_cpu = make__pas_interface_multicore;
    result.i_gpu = make__pas_interface_gpu;
    return result;
  }
} // extern C
